run_test_args "slow" "9 10 8 7 6 5 4 3 2 1" "Enter sequence of integers, each followed by a space: Number of inversions: 44"
run_test_args "slow" "8 2 57 1 38 10 57 29 48 2 76 94 11" "Enter sequence of integers, each followed by a space: Number of inversions: 26"
run_test_args "slow" "8 2 1 38 57 10 57 29 2 76 94 11 48" "Enter sequence of integers, each followed by a space: Number of inversions: 24"
run_test_args "slow" "$(echo {1..100000})" "Enter sequence of integers, each followed by a space: Number of inversions: 0"
run_test_args "slow" "$(echo {100000..1})" "Enter sequence of integers, each followed by a space: Number of inversions: 4999950000"
